import React from 'react';
import s from './MyPost.module.css'
import Post from "./Post/Post";

const MyPost = () => {
    let PostData = [
        {id:1,text:'acascascascsac',like:22},
        {id:2,text:'acascascascsac',like:22},
        {id:3,text:'acascascascsac',like:22},
        {id:4,text:'acascavdvdvdscascsac',like:22}
    ]
    let PostMass = PostData.map(Postdata=><Post message={Postdata.text} like={Postdata.like} />)

    return (
        <div>
            <div>
                <textarea name="" id="" cols="30" rows="1"></textarea>
                <button>добавить</button>
                <button>удалить</button>
            </div>
            {PostMass}
        </div>
    );
}
export default MyPost;
